@Crazando anonymous The only thing we know is pessimism. This is because we've seen our parents drown in debts and because we were born into a world where America is in war. I'm not saying we're all pessimistic, but rather that most of us can't see anything but pessimism due to the world we were born into and experienced. We were born into a world of school shootings practically every week and a world where terrorism attacks are basically the norm. We were also born into a world where Americas economy isn't the greatest as education after highscool is hardly affordable without getting a loan and drowning in debt.

The tuition for colleges grew exponentially as the annual tuition for Yale was $2,550 in 1970s while in 2014 it was $45,800 and the cost for medical care, food, and shelter has also grew exponentially.

You can't just tell someone who's depressed to be happy. That's not how it works. Telling someone that to see the greater things in the world is like telling someone who's starving to just go get some food. You don't automatically become happy with who you are or just automatically become happy in general just by a couple of sentences. It takes time to see the world in different ways.

@Crazando anonymous They weren't scared of WW2 yet they were scared of the cold war. They had drills where they'd hide under a desk at school to keep cover from an atomic blast, after realising that you basically can't defend that without a bunker, they stopped. And no, if you're poor you don't just automatically have the greatest opportunity to be rich. Calling us wealkings is the equivalent of calling a 3 yo unintelligent because they're unable to speak properly or even at all. This is because a majority of iGen are teens. Also, calling us wealkings is still quite dumb because we can't do much at our ages. And America is also a place where you have to be afraid of shootings anywhere you go. During the first 21 weeks of 2018 there were 23 school shootings. Winston Salem Shooting, Italy Texas shooting, Benton Kentucky, Philadelphia, Los Angeles, Oxon Hill, Maryland shooting, Nashville Shooting, Parkland shooting, Savannah Georgia, Itta Bena, Norfolk Virginia, Mount Pleasant, Jackson shooting, Birmingham shooting, Mobile shooting, Seaside shooting, Lexington Park, Gloversville, Raytown, Ocala, Palmdale, Santa Fe, Noblesville, Thousand Oaks, Watertown, must I keep going? Yes? Okay

Long Beach, Tallahassee, Springfield, Minneapolis, Detroit, Vallejo, LA, Riverside 2x, El Dorado, and many more. Being pessimistic is more reasonable than thinking everything is a-okay in the United States. Being the smartest or most popular brings competitiveness. Oh, you want us to be philosophical? Sorry, that's not how the world works. Not everyone has experienced what you have. You're merely speaking off of how you see the world rather than looking at your own generation's panic. You want us to all be philosophical as if it's the answer to everything. Not everyone was born in the same conditioning as you. Empathy is basically the most you could give someone as most of us are too scared to speak to others about our true intentions and/or feelings. Let's take someone who was abused as a child and currently is still abused, tell them to not be pessimistic and tell them to be philosophical, how would that play out?

Oh, you're afraid of your father beating you? I'm sure you're just being pessimistic. Someone just threaten your school with a picture of a gun on Snapchat saying, "Don't go to school tomorrow" and no one arrives and you think what pessimistic idiots. You just got done hearing of the Syria bombings and watching a couple of children dying, oh, just pessimism. You hear gunshots whilst in school and hide under your desk, oh, why am I being so pessimistic? See how dumb it is? Oh, your two cousins were killed in a school shooting? I'm sure you just need to see the world positively.

