Technology is the main reason you'd likely call it the best though, we have it better, yes, but not the best.

@Symphony No.5 As Gen Z, I couldn't agree more. You see, I have very moderate beliefs, if anything I am more of a moderate libertarian than anything. 

Look, I don't care if you are a Millennial or Genz, Liberal or Conservative, if you have common sense, I can have you as a co-worker or peer/friend.
I do support marriage equality, racial equality, gender equality, not because of being raised in a multicultural America, but that is important to me. Think about how Baby Boomers in the Civil Rights movement made it possible to even change the same things we fight for today.
